/* eslint-disable react/prop-types */
import React from 'react';
import styled from 'styled-components';

const Layout = props => {
	const LayoutStyle = styled.div`
		margin: 20;
		padding: 20;
		border: '1px solid #DDD';
	`;

	return (
		<LayoutStyle>
			<p>Top Stories</p>
			{props.children}
		</LayoutStyle>
	);
};

export default Layout;
